import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';
import Converter from './components/converter'

function App() {

  const [file, setFile] = useState('');
  setFile('./p');

  return (
    <div className="App">
      <Converter
        file = {file}
        setFile = {setFile}
      >
      </Converter>
    </div>
  );
}

export default App;
